import Loading from './Loading';

export default class DogItemCarousel extends Component{ 
  
  renderDog=(props)=>{
     
    if(props.dog && props.key && props.key ==='0'){
   return  (  <div key={props.key} className="carousel-item active ">
    <img className=" img-thumbnail w-100" src={props.dog} alt="Second slide" />
  </div>)
    } else if(props.dog && props.key){
      return dog = <div key={props.key} className="carousel-item">
      <img className=" img-thumbnail w-100" src={props.dog} alt="Second slide" />
    </div>
    }
  }
   render(){
     return(
       <div> {this.renderDog()}</div>
     )
   }
}
